import { React } from 'react';
import './App.css'
import {Routes, Route } from "react-router-dom";
 import ReadOrder from'./omsOrder/ReadOrder'
 import PlaceOrder from'./omsOrder/PlaceOrder'
 import UpdateOrder from'./omsOrder/UpdateOrder'
 import ViewDetails from'./omsOrder/ViewDetails'
 import MyNavbar from'./omsOrder/MyNavbar'
import MyFormValidation from './omsOrder/sweetAlter/MyFormValidation'
function App() {

  return (
    <div style={{background:"white"}} >
      <MyNavbar/>
      <Routes>
        <Route exact path="/" element={<ReadOrder/>} />
        <Route exact path="/placeorder" element={<PlaceOrder />} />
        <Route exact path="/updateorder/:displayOrderId" element={<UpdateOrder />} />
        <Route exact path="/viewdetails" element={<ViewDetails />} />
        <Route exact path="/f" element={<MyFormValidation />} />
      </Routes>
    </div>
  );
}
export default App;
